import { useState } from 'react'

const Login = ({Detail}) => {
    const [mail,setMail] = useState("")
    const [pass,setPass] = useState("")
    
    function onSub(e){
        e.preventDefault()
        if (!pass){
            alert("Please Enter Password")
            return
        }
        Detail({mail})
        const m = mail;
        setMail("")
        setPass("")
    }

    function changeMail(e){
        setMail(e.target.value)
    }
    

    return (
        <section className="container">
            <form className="form" onSubmit={onSub}>
                <div>
                    <label>Email</label>
                    <input type="email" placeholder="Enter email" value={mail} onChange={changeMail}/>
                </div>
                <div>
                    <label>Password</label>
                    <input type="password"  placeholder="Enter password" value={pass} onChange={(e) => setPass(e.target.value)}/>
                </div>
                <div>
                    <input className="btn" type="submit"/>
                </div>
            </form> 
        </section>    
    )
}

export default Login
